func largestIsland(grid [][]int) int {
	mark := -1

	markAreas := make(map[int]int)

	var dfs = func(x, y int) int { return 0 }
	dfs = func(x, y int) int {
		if x < 0 || x > len(grid)-1 ||
			y < 0 || y > len(grid[x])-1 ||
			grid[x][y] <= 0 {
			return 0
		}

		if grid[x][y] == 1 {
			grid[x][y] = mark
		}

		return dfs(x-1, y) +
			dfs(x+1, y) +
			dfs(x, y-1) +
			dfs(x, y+1) + 1
	}

	for i := 0; i < len(grid); i++ {
		for j := 0; j < len(grid[i]); j++ {
			if area := dfs(i, j); area != 0 {
				markAreas[mark] = area
				mark--
			}
		}
	}

	maxResult := 0

	for i := 0; i < len(grid); i++ {
		for j := 0; j < len(grid[i]); j++ {
			if grid[i][j] != 0 {
				maxResult = max(markAreas[grid[i][j]], maxResult)
				continue
			}

			leftMark := 0
			rightMark := 0
			topMark := 0
			botMark := 0
			if i-1 >= 0 {
				leftMark = grid[i-1][j]
			}
			if i+1 <= len(grid)-1 {
				rightMark = grid[i+1][j]
			}
			if j-1 >= 0 {
				topMark = grid[i][j-1]
			}
			if j+1 <= len(grid[0])-1 {
				botMark = grid[i][j+1]
			}

			points := []Point{
				{
					mark: leftMark,
					area: markAreas[leftMark],
				}, {
					mark: rightMark,
					area: markAreas[rightMark],
				}, {
					mark: topMark,
					area: markAreas[topMark],
				}, {
					mark: botMark,
					area: markAreas[botMark],
				},
			}

			slices.SortFunc(points, func(a, b Point) int {
				if b.area == a.area {
					return b.mark - a.mark
				}
				return b.area - a.area
			})

			for direction := 3; direction >= 0; direction-- {
				if points[direction].area == 0 {
					points = points[:len(points)-1]
				}
				if direction < len(points)-1 && points[direction].mark == points[direction+1].mark {
					points = append(points[:direction], points[direction+1:]...)
				}
			}

			if len(points) == 1 {
				maxResult = max(points[0].area+1, maxResult)
			} else if len(points) == 2 {
				maxResult = max(points[0].area+points[1].area+1, maxResult)
			} else if len(points) == 3 {
				maxResult = max(points[0].area+points[1].area+points[2].area+1, maxResult)
			} else if len(points) == 4 {
				maxResult = max(points[0].area+points[1].area+points[2].area+points[3].area+1, maxResult)
			} else {
				maxResult = max(maxResult, 1)
			}
		}
	}

	return maxResult
}

type Point struct {
	mark int
	area int
}
